import React from 'react'

export default function Footer() {
  return (
    <footer>
        <div className="left-footer">
            <p className="copyright">&copy; Surrounded by Crime</p>
            <a href="#">ABOUT</a>
            <a href="#">CONTACT</a>
        </div>
    </footer>
  )
}
